  {host_id: 123, spot_type: "Shared Room", title: "Crow Valley Mansion", description: "From the outside this house looks gorgeous. It has been built with sandstone and has cypress wooden decorations. Large, octagon windows add to the overall style of the house and have been added to the house in a very asymmetric way.\n\nThe house is equipped with a large kitchen and two modern bathrooms, it also has a fairly small living room, two bedrooms, a snug dining room, a library and a roomy basement.\n\nThe building is rectangular shaped. The house is partially surrounded by a covered patio on two sides.\nThe second floor is the same size as the first, but part of it hangs over the edge of the floor below, creating an overhang on one side and a balcony on the other. This floor has a very different style than the floor below.\n\nThe roof is low and square shaped and is covered with brown wood shingles. Two large chimneys sit at either side of the house. Several long, thin windows let in plenty of light to the rooms below the roof.\nThe house itself is surrounded by paved ground, with a pool at the backside of the house.", price: 102, lat: 46.869566, lng: -96.736946, capacity: 12, img_file_name: nil, img_content_type: nil, img_file_size: nil, img_updated_at: nil, location: "78 Walnut Street Moorhead, MN United States"},
  {host_id: 127, spot_type: "Entire place", title: "Raindrop Residence", description: "From the outside this house looks snug and comfortable. It has been built with white cedar wood and has brown brick decorations. Large, octagon windows allow enough light to enter the home and have been added to the house in a fairly symmetrical pattern.\n\nThe house is equipped with an average kitchen and one modern bathroom, it also has a small living room, three bedrooms, a modest dining area, a sun room and a grand basement.\n\nThe building is shaped like a short U. The two extensions are linked by wooden overhanging panels.\nThe second floor is smaller than the first, which allowed for several balconies on the sides of the house. This floor has a very different style than the floor below.\n\nThe roof is low and pyramid shaped and is covered with dark ceramic tiles. Two small chimneys sit at either side of the house. Several long, thin windows let in plenty of light to the rooms below the roof.\nThe house itself is surrounded by paved ground, with a pool at the backside of the house.", price: 178, lat: 40.177867, lng: -76.173041, capacity: 2, img_file_name: nil, img_content_type: nil, img_file_size: nil, img_updated_at: nil, location: "9625 Johnson Street Ephrata, PA United States"},
  {host_id: 119, spot_type: "Shared Room", title: "Broadriver Residence", description: "From the outside this house looks cozy. It has been built with fir wood and has oak wooden decorations. Small, rounded windows add to the overall style of the house and have been added to the house in a mostly symmetric way.\n\nThe house is equipped with a large kitchen and one small bathroom, it also has a warm living room, five bedrooms, a grand dining area and a modest basement.\n\nThe building is square shaped. The house is half surrounded by wooden sunscreens structures.\nThe second floor is bigger than the first, which creates a stylish overhang around the entire house. This floor has roughly the same style as the floor below.\n\nThe roof is low and triangular and is covered with brown ceramic tiles. Two large chimneys sit at either side of the house. Several large windows let in plenty of light to the rooms below the roof.\nThe house itself is surrounded by a modest garden, with mostly grass, a few flower patches and a children's playground.", price: 137, lat: 45.677782, lng: -111.023688, capacity: 8, img_file_name: nil, img_content_type: nil, img_file_size: nil, img_updated_at: nil, location: "791 South Cypress St. Bozeman, MT United States"},
