  {host_id: 122, spot_type: "Entire place", title: "Oak Valley Estate", description: "From the outside this house looks warm and cozy. It has been built with sandstone and has marble decorations. Short, wide windows add to the overall style of the house and have been added to the house in a fairly symmetrical pattern.\n\nThe house is equipped with a modern kitchen and one average bathroom, it also has a snug living room, two bedrooms, a snug dining area and a large storage room.\n\nThe building is shaped like an L. The extension extends into wooden overhanging panels reaching until the end of that side of the house.\nThe second floor is smaller than the first, which allowed for a large balcony on one side of the house. This floor has roughly the same style as the floor below.\n\nThe roof is high and rounded and is covered with red wood shingles. Two small chimneys sit at the side of the house. Several large windows let in plenty of light to the rooms below the roof.\nThe house itself is surrounded by paved ground, with an outdoor eating and relaxing space and various potted plants.", price: 189, lat: 42.954278, lng: -78.838801, capacity: 8, img_file_name: nil, img_content_type: nil, img_file_size: nil, img_updated_at: nil, location: "562 Parker Street Buffalo, NY United States"},
